function Filter() {
  return (
    <div>
      <Price />
      <Discount />
      <Color />
      <Size />
    </div>
  );
}

export default Filter;

// Sub-components

function Price() {
  const position = {
    container: "pb-4",
  };
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div className={position.container}>
      <h4 className={design.heading}>Price</h4>
      <label for="0-1000">0-1000</label>
      <input type="radio" name="0-1000" />
    </div>
  );
}

function Discount() {
  const position = {
    container: "pb-4",
  };
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div className={position.container}>
      <h4 className={design.heading}>Discount</h4>
    </div>
  );
}

function Color() {
  const position = {
    container: "pb-4",
  };
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div className={position.container}>
      <h4 className={design.heading}>Color</h4>
    </div>
  );
}

function Size() {
  const position = {
    container: "pb-4",
  };
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div className={position.container}>
      <h4 className={design.heading}>Size</h4>
    </div>
  );
}
